  const { isLoading, data, error } = useFetch('https://jsonplaceholder.typicode.com/users')
  data && console.log(data)

  const [contactList, setContactList] = useState({ initialState:null })
  const [filterQuery, setFilterQuery] = useState({ initialState:null })

  useEffect(() => {
    if (filterQuery) {
      //do something
    }
    else {
      setContactList(data?.res)
    }
  }) //, deps:[data, filterQuery])

  return (
    <div className = {"bg-gray-100"}> 
      <section> 
        <form>
          <input
            type = "text"
            className = "ml-20 mt-6 rounded-md p-2" 
            placeholder="type here to filter..." 
          />
        </form>
      </section>
      <section className = "p-20 grid sm:grid-cols-2 md:grid-cols-4 gap-6">
        <ContactCards contactList = {contactList}/>
      </section>
    </div>
  );
}

export default App;
